import React from 'react';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

function HomePage({ onStart }) {
  return (
    <div className="HomePage">
      <Typography variant="h2" gutterBottom>
        Welcome to Take It Easy!
      </Typography>
      <Typography variant="body1" paragraph>
        Take It Easy is a simple yet addictive puzzle game. Arrange tiles on the
        board to score as many points as possible. Follow the instructions below
        to get started.
      </Typography>
      <Typography variant="h6">Instructions:</Typography>
      <Typography variant="body2" paragraph>
        1. Select an AI player to compete against. 2. Tiles will be generated
        randomly. 3. Place the tiles on the board to form continuous lines of
        the same color. 4. The game ends when all tiles are placed. 5. The
        player with the highest score wins!
      </Typography>
      <Button variant="contained" color="primary" onClick={onStart}>
        Start Game
      </Button>
    </div>
  );
}

export default HomePage;
